import React from 'react';
import './style/HomePage.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function HomePage() {
  return (
    <Router>
      <div className="HomePage">
        <h1>Welcome to the Library Management System</h1>
        <p>Your one-stop solution for managing books and issued items.</p>
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/booklist">Book List</Link></li>
            <li><Link to="/login">Login</Link></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<h2>Welcome to the Library</h2>} />
          <Route path="/booklist" element={<h2>Explore Our Book Collection</h2>} />
          <Route path="/login" element={<h2>Login to Your Account</h2>} />
        </Routes>
      </div>
    </Router>
  );
}

export default HomePage;
